import React, { useEffect } from "react";

const IntroText = () => {
  return (
    <div>

<p>Hi, I'm <span className="bold">Niels</span>,<br></br> I am Fullstack Software Developer that has just entered the Tech space. Passionate about coding, learning new skills, travelling and riding my bike. Would you like to know more about me? Check out my projects on <span className="bold"><a href="www.github.com" >Github</a></span>, read some of my blog post on my <span className="bold"><a href="www.LinkedIn.com" >LinkedIn</a></span> or reach out on <span className="bold"><a href="www.github.com" >Github</a></span>. 
<br></br><br></br>
I am currently updating my portfolio.
</p>


    </div>
  );
};

export default IntroText;
